select tmpName, patientCode, firstName, lastName, MiddleInitial, suffix, medicalRecordNumber
	, substring( tmpName, 2,  charindex(' ', tmpName, 3)-1 )
from zz_import_20100730_patientMaster
where suffix in (
'Sr',
'Sr,',
'Sr.',
'Jr',
'Jr.',
'II',
'III'
)
and charindex(' ', tmpName, 3) > 0


